import React from 'react';

const BookSingle = (props) => {
    return ( 
        <div className="row">
            <div className="col s12">
                <div className="card">
                    <div className="card-image">
                        <img src="books.jpeg"/>
                        <span className="card-title">{props.books.name} {props.books.name}</span>
                    </div>
                    <div className="card-content">
                        <p>
                            Age: {props.books.author}
                        </p>
                        <p>
                            Page: {props.books.page}
                        </p>
                        <p>
                            Price: {props.books.price}
                        </p>
                    </div>
                    <div className="card-action">
                        Team: {props.books.isGood}
                    </div>
                </div>
            </div>
        </div>
    );
}
 
export default BookSingle;
